import footer from './footer.png';
function Footer() {
    return (
        <footer>
            <div style={{display:'flex'} }>
                <img src={footer} alt="footer"></img>
                <ul>
                    <li>Home</li>
                    <li>About</li>
                    <li>menu</li>
                    <li>Reservation</li>
                    <li>Order online</li>
                    <li>Login</li>
                </ul>
                <p>&copy; 2024 Little Lemon. All rights reserved.</p>
            </div>
        </footer>
    );
}

export default Footer;
